import React from "react";
import "./Components.css";

export default function Components({ id, name, content, handleAdd }) {
  return (
    <div className="card">
      <div className="title">
        <h3>
          {id}.{name}
        </h3>
        <p>{content}</p>
        <button onClick={handleAdd}>Click</button>
      </div>
    </div>
  );
}
